// Settings.js  
import React, { useState } from 'react';  
import './Settings.css';  

const Settings = () => {  
  const [userName, setUserName] = useState('');  
  const [email, setEmail] = useState('');  
  const [password, setPassword] = useState('');  
  const [confirmPassword, setConfirmPassword] = useState('');  
  const [threshold, setThreshold] = useState('');  
  const [pricePerKw, setPricePerKw] = useState('');  

  const handleSubmit = (e) => {  
    e.preventDefault();  
    // Handle form submission (e.g., send data to the backend)  
    console.log({ userName, email, password, threshold, pricePerKw });  
  };  

  return (  
    
    <div className="app-container">  
      <Sidebar />  
      <div className="settings-container">  
        <h2>Settings</h2>  
        <form onSubmit={handleSubmit}>  
          <div className="profile-section">  
            <div className="profile-image">  
              ðŸ‘¤ {/* Icon representing the user. Replace with an actual image if needed */}  
            </div>  
            <div cla>  
              <input  
                type="text"  
                placeholder="User Name"  
                value={userName}  
                onChange={(e) => setUserName(e.target.value)}  
                required  
              />  
              <input  
                type="email"  
                placeholder="Email"  
                value={email}  
                onChange={(e) => setEmail(e.target.value)}  
                required  
              />  
              <input  
                type="password"  
                placeholder="Password"  
                value={password}  
                onChange={(e) => setPassword(e.target.value)}  
                required  
              />  
              <input  
                type="password"  
                placeholder="Confirm Password"  
                value={confirmPassword}  
                onChange={(e) => setConfirmPassword(e.target.value)}  
                required  
              />  
            </div>  
          </div>  

          <div className="settings-section">  
            <input  
              type="number"  
              placeholder="Threshold in kW"  
              value={threshold}  
              onChange={(e) => setThreshold(e.target.value)}  
              required  
            />  
            <input  
              type="number"  
              placeholder="Price of 1 kW"  
              value={pricePerKw}  
              onChange={(e) => setPricePerKw(e.target.value)}  
              required  
            />  
          </div>  

          <button type="submit">Save Changes</button>  
        </form>  
      </div>  
    </div>  
  );  
};  

const Sidebar = () => (  
  <nav className="sidebar">  
    <div className="logo">ðŸ”„</div>  
    <input type="text" placeholder="Search..." className="search-input" />  
    <ul>  
      <li><a href="/dashboard">Dashboard</a></li>  
      <li><a href="/consumption">Consumption</a></li>  
      <li><a href="/billing">Billing</a></li>  
      <li className="active"><a href="/settings">Settings</a></li>  
      <li><a href="/login">Sign Out</a></li>  
    </ul>  
  </nav>  
);  

export default Settings;
